INSERT INTO `abs_base_info_child` VALUES ('41', '10', 'SF1899', '公投曲胜高速公路专项计划', 'AA+', null, '35', '100.00%', '2028-01-12', null, '4.03%', '利息偿还方式为每年付息一次。专项计划存续期内，本专项计划于2017年1月12日、2018年1月12日、2019年1月12日、2020年1月12日、2021年1月12日、2022年1月12日、2023年1月12日、2024年1月12日、2025年1月12日、2026年1月12日、2027年1月12日、和2028年1月12日向资产支持证券持有人支付预期收益和本金，遇法定节假日或休息日顺延至其后第一（1）个工作日，每年偿还本金规模依次为1.5亿元、1.8亿元、2.0亿元、2.4亿元、2.6亿元、3.0亿元、3.2亿元、3.4亿元、3.6亿元、3.7亿元、3.8亿元以及4.0亿元。', '利息偿还方式为每年付息一次，采用浮动利率计息，自专项计划设立日起执行初始利率4.03%；在专项计划存续期内，且调整后的基准利率已开始执行，则自每次降低或提高利率并开始执行之后第一个计息期首日（以下简称“该计息期首日”）起资产支持证券的预期收益率按该计息期首日五年期贷款基准利率基础上降低0.01%后的利率执行。', null, null, null);
