INSERT INTO `abs_base_info_child` VALUES ('77', '17', 'SF9207', '华鑫-中国化工优先级', 'AAA', null, '11', '1', '2017-4-29', null, null, '在专项计划未发生加速清偿事件或违约事件的情况下，在兑付日按照《标准条款》第11.1.1款的约定支付优先级资产支持证券的各计息期间的收益和本金。即预计于兑付日一次还本付息。（如因中国的法定公休日、节假日，使得兑付日实际情况早于或晚于前述预计情况的，计划管理人将于专项计划收款日前进行公告，实际兑付日以计划管理人公告为准）。在专项计划进入加速清偿程序或发生违约事件情况下，于兑付日按照《标准条款》第11.1.2款的约定支付本金和收益。在专项计划进入加速清偿程序的情况下，兑付日为回购通知日后第二十（20）个工作日；在发生违约事件的情况下，兑付日为违约事件发生日后第六十（60）个工作日', '在专项计划未进入加速清偿程序且未发生违约事件的情况下，兑付日预计时间为专项计划设立日后一年（一年按365天计）（如因中国的法定公休日、节假日，使得兑付日实际情况早于或晚于前述预计情况的，计划管理人将于专项计划收款日前进行公告，实际兑付日以计划管理人公告为准），各级证券到期一次还本付息；在专项计划进入加速清偿程序的情况下，兑付日为回购通知日后第二十（20）个工作日；在发生违约事件的情况下，兑付日为违约事件发生日后第六十（60）个工作日。', null, null, null);
INSERT INTO `abs_base_info_child` VALUES ('78', '17', 'SF9025', '中化次级', '无', null, '0.60', '5.0%', '2017-04-29 00:00:00', null, null, '在每个兑付日按照《标准条款》第11.1款的约定对次级资产支持证券进行分配', '在专项计划未进入加速清偿程序且未发生违约事件的情况下，兑付日预计时间为专项计划设立日后一年（一年按365天计）（如因中国的法定公休日、节假日，使得兑付日实际情况早于或晚于前述预计情况的，计划管理人将于专项计划收款日前进行公告，实际兑付日以计划管理人公告为准），各级证券到期一次还本付息；在专项计划进入加速清偿程序的情况下，兑付日为回购通知日后第二十（20）个工作日；在发生违约事件的情况下，兑付日为违约事件发生日后第六十（60）个工作日。', null, null, null);
