INSERT INTO `abs_base_info_child` VALUES ('96', '23', 'SG4361', '金陵1号（优先级01）', 'AAA', null, '220.00000000000003%', '13.750000000000002%', '2016-12-30', null, '3.5999999999999996%', '专项计划在兑付日向持有人兑付优先级预期收益及次级不超过6%的期间收益，剩余资金按照优先级别次序摊还证券本金。底层委贷到期还款/提前还款时间如果不是上述分配节点，则临时进行兑付，按照证券优先级别次序摊还本金及对应当期收益，直到专项计划收到的本金资金全部摊还完毕。', '优先级证券按照各自的预期收益率计算当期收益，次级证券在专项计划收到的信托项下的收益资金充足的情况下，可获得不超过6%/年的期间收益。剩余资金按照优先级别次序摊还证券本金。', null, null, null);
