INSERT INTO `abs_base_info_child` VALUES ('105', '28', 'SP2821', '昆仑信托信托受益权资产支持专项计划优先级资产支持证券', 'AAA', null, '500.0%', '80.65%', '2019-09-20', null, '3.9600000000000004%', '1、违约事件发生前，收益分账户项下\n（1）支付专项计划应承担的税收、执行费用；\n（2）支付登记托管机构的资产支持证券上市、登记、资金划付等相关费用；\n（3）支付托管银行托管费、其他中介机构服务费及其他专项计划费用；\n（4）支付应付的优先级资产支持证券的当期预期收益；\n（5）如发生加速清偿事件，余额全部转入本金分账户；\n（6）如未发生加速清偿事件，转入本金分账户违约基础资产的未偿本金余额和本金账户累计转入收益账户净额\n本金分账户项下\n（1）如果在上一计息期间收益分账户的余额不足以支付在该分配日收益分账户应支付的（1）-（4）项，本金分账户应转入收益分账户相应的金额；\n（2）支付优先级资产支持证券的未偿本金，直至优先级资产支持证券的未偿本金余额为零。\n3、违约事件发生后，将不再区分本金分账户和收益分账户。\n（1）支付专项计划应承担的税收、执行费用；\n（2）支付登记托管机', '1、优先级资产支持证券的当期预期收益=优先级资产支持证券在前一个兑付日本金偿付完毕后的未偿本金余额×优先级资产支持证券的预期年收益率×计息期间的实际天数÷365。\n2、在专项计划分配日计划托管人将专项计划分配资金从专项计划账户划拨至报价系统公司指定的账户。\n3、在专项计划兑付日报价系统公司将实际分配资金直接划付至各结算参与人结算备付金账户，各结算参与人根据报价系统公司结算数据中的资产支持证券持有人获得分配资金明细数据将相应款项划拨至各资产支持证券持有人的资金账户。', null, null, null);
INSERT INTO `abs_base_info_child` VALUES ('106', '28', 'SP2822', '昆仑信托信托受益权资产支持专项计划次级资产支持证券', null, null, '120.0%', '19.35%', '2019-09-20', null, null, '专项计划存续期不安排次级资产支持证券的本金与收益分配，次级支持证券只参与清算资产的分配。\n专项计划的清算资产按下列顺序清偿（同一分配顺序下如有不足，则按比例分配）：\n（a）支付清算费用；\n（b）交纳专项计划所欠税款（如有）；\n（c）支付登记托管机构的资产支持证券登记、资金划付等相关费用、执行费用；\n（d）清偿未受偿的管理费、托管费及其它专项计划费用；\n（e）支付所有应付未付优先级资产支持证券的预期收益；\n（f）支付先级资产支持证券未受偿本金，直至优先级资产支持证券的未偿本金余额为零；\n（g）剩余专项计划资产按其当时原状分配给次级资产支持证券持有人。', null, null, null, null);
