INSERT INTO `abs_base_info_child` VALUES ('140', '37', 'SP4886', '公投玉元高速公路专项计划', 'AAA', null, '50', '100.00%', ' 2030-11-16', null, '4.40%', '利息偿还方式为每季付息一次。专项计划存续期内，本专项计划于2017年、2018年、2019年、2020年、2021年、2022年、2023年、2024年、2025年、2026年、2027年、2028年、2029年、2030年每年2月16日、5月16日、8月16日和11月16日向资产支持证券持有人支付预期收益和本金，遇法定节假日或休息日顺延至其后第一（1）个工作日，每季偿还本金规模依次为9,000万元、6,200万元、6,900万元、5,200万元、5,500万元、6,700万元、7,400万元、5,700万元、5,900万元、7,200万元、8,000万元、6,200万元、6,500万元、7,900万元、8,700万元、6,900万元、7,200万元、8,100万元、8,800万元、7,100万元、7,400万元、8,400万元、9,100万元、7,400万元、7,700万元、8,600万元、9,400万元、7,700万元、8,100万元、9,000万元、9,700万元、8,000万元、8,400万元、9,400万元、10,100万元、8,400万元、8,900万元、9,800万元、10,600万元、8,900万元、9,400万元、10,400万元、11,200万元、9,600万元、10,100万元、11,100万元、11,900万元、10,300万元、10,800万元、11,800万元、12,600万元、11,000万元、11,600万元、12,600万元、13,500万元、16,000万元。', '资产支持证券的年预期收益率为浮动利率：（1）自专项计划设立日起至第四个兑付日（不含该日）期间，执行初始利率为4.3973%；（2）除前述（1）项约定外，在专项计划存续期内，如果发生中国人民银行调整（提高或降低）基准利率的情形，且调整后的基准利率已开始执行，则自每次降低或提高基准利率并开始执行之日所处自然年度最后一个兑付日（含该日以下简称“该计息期首日”）起，资产支持证券的预期收益率按照在该计息期首日五年期以上贷款基准利率基础上降低6.53%后的利率执行。资产支持证券除前述约定外无其他超额收益。', null, null, null);
INSERT INTO `abs_base_info_child` VALUES ('142', '39', 'SQ4426', '融侨集团专项计划优先A级', 'AAA', null, '6.10', '61.49%', '2019-2-18', null, '5.80', '本专项计划的资产支持证券目标募集总规模为人民币9.92亿元，优先级A资产支持证券的目标募集规模为6.10亿元，证券评级结果为AAA，期限两年，预期收益率为固定利率5.8%，每年付息一次，到期一次性还本；优先级B资产支持证券的目标募集规模为3.05亿元，证券评级结果为AA+，期限两年，预期收益率为固定利率6.3%，每年付息一次，到期一次性还本；次级资产支持证券的目标募集规模为0.77亿元，无评级结果，期限两年，无预期收益率，到期一次性偿还。', '优先级A资产支持证券每年付息一次，到期一次性还本。优先级B资产支持证券每年付息一次，到期一次性还本。次级资产支持证券到期一次性偿还。', null, null, null);
