INSERT INTO `abs_base_info_child` VALUES ('155', '43', 'SP9501', '兴信一期专项计划优先A', ' AAA', null, '630.0%', '44.24%', '2018-06-01', null, '3.70%', '“利息兑付日”或“T日”系指专项计划存续期间内，计划管理人将专项计划托管账户内资金按专项计划约定进行利息分配的日期，为自专项计划成立起每自然年度【6】月和【12】月的最后一个工作日。其中，第一个“利息兑付日”为【2017】年【6】月【30】日。\n“本金兑付日”就专项计划而言，系指每个信托本金分配日后的第【6】个工作日（R+6日），正常情况下本金兑付日为【2017年2月16日】、【2017年7月27日】、【2018年1月15日】、【2018年6月5日】、【2018年8月23日】、【2018年9月20日】、【2018年9月21日】、【2019年12月5日】。', '“利息兑付日”或“T日”系指专项计划存续期间内，计划管理人将专项计划托管账户内资金按专项计划约定进行利息分配的日期，为自专项计划成立起每自然年度【6】月和【12】月的最后一个工作日。其中，第一个“利息兑付日”为【2017】年【6】月【30】日。', null, null, null);
