INSERT INTO `abs_base_info_child` VALUES ('157', '43', 'SP9503', '兴信一期专项计划次级', '无', null, '71.0%', '4.99%', '2019-12-03', null, '不超过4.00%', '“利息兑付日”或“T日”系指专项计划存续期间内，计划管理人将专项计划托管账户内资金按专项计划约定进行利息分配的日期，为自专项计划成立起每自然年度【6】月和【12】月的最后一个工作日。其中，第一个“利息兑付日”为【2017】年【6】月【30】日。\n“本金兑付日”就专项计划而言，系指每个信托本金分配日后的第【6】个工作日（R+6日），正常情况下本金兑付日为【2017年2月16日】、【2017年7月27日】、【2018年1月15日】、【2018年6月5日】、【2018年8月23日】、【2018年9月20日】、【2018年9月21日】、【2019年12月5日】。', '“利息兑付日”或“T日”系指专项计划存续期间内，计划管理人将专项计划托管账户内资金按专项计划约定进行利息分配的日期，为自专项计划成立起每自然年度【6】月和【12】月的最后一个工作日。其中，第一个“利息兑付日”为【2017】年【6】月【30】日。', null, null, null);
INSERT INTO `abs_base_info_child` VALUES ('158', '44', 'SQ1909', '中建六局应收账款资产支持专项计划优先级A档资产支持证券', 'AA+', null, '2.45', '18.01%', '2019-03-21', null, '5.30', '循环期按年付息，不偿还本金，首次付息日2017年12月21日；循环期后按季付息，本金过手摊还。付息日分别为2017/12/21、2018/12/21和2019/3/21', '循环期按年付息，不偿还本金，首次付息日2017年12月21日；循环期后按季付息，本金过手摊还。', null, null, null);
INSERT INTO `abs_base_info_child` VALUES ('159', '44', 'SQ1910', '中建六局应收账款资产支持专项计划优先级B档资产支持证券', 'AA', null, '8.70', '63.94', '2019-09-20 00:00:00', null, '6.20', '循环期按年付息，不偿还本金，首次付息日2017年12月21日；循环期后按季付息，本金过手摊还。付息日分别为2017/12/21、2018/12/21、2019/3/21、2019/6/21、2019/9/20', '循环期按年付息，不偿还本金，首次付息日2017年12月21日；循环期后按季付息，本金过手摊还。', null, null, null);
INSERT INTO `abs_base_info_child` VALUES ('160', '45', 'SQ1766', '恒泰弘泽-华远盈都商业资产支持专项计划A类资产支持证券', 'AAA', null, '2.90', '39.40', '2035-2-14', null, '5.80', '就普通分配而言，A类、B类、和C类资产支持证券的预期收益均为每年分配，A类资产支持证券的本金偿付为每年还本（每年向A类资产支持证券偿还的本金为预期分配本金，超额分配本金的分配按照《标准条款》第12.2.1条的约定执行），B类和C类资产支持证券的本金偿付为到期还本。\n在A类、B类和C类资产支持证券正常存续情况下，收益分配日指专项计划存续期内，自2018年起每一自然年度的2月14日（若该日为非工作日则为该日后的第一个工作日）。', '就普通分配而言，A类、B类、和C类资产支持证券的预期收益均为每年分配。在A类、B类和C类资产支持证券正常存续情况下，收益分配日指专项计划存续期内，自2018年起每一自然年度的2月14日（若该日为非工作日则为该日后的第一个工作日）。', null, null, null);
INSERT INTO `abs_base_info_child` VALUES ('161', '45', 'SQ1767', '恒泰弘泽-华远盈都商业资产支持专项计划B类资产支持证券', 'AAA', null, '4.36', '59.24', '2035-2-14', null, '6.30', '就普通分配而言，A类、B类、和C类资产支持证券的预期收益均为每年分配，A类资产支持证券的本金偿付为每年还本（每年向A类资产支持证券偿还的本金为预期分配本金，超额分配本金的分配按照《标准条款》第12.2.1条的约定执行），B类和C类资产支持证券的本金偿付为到期还本。\n在A类、B类和C类资产支持证券正常存续情况下，收益分配日指专项计划存续期内，自2018年起每一自然年度的2月14日（若该日为非工作日则为该日后的第一个工作日）。', '就普通分配而言，A类、B类、和C类资产支持证券的预期收益均为每年分配。在A类、B类和C类资产支持证券正常存续情况下，收益分配日指专项计划存续期内，自2018年起每一自然年度的2月14日（若该日为非工作日则为该日后的第一个工作日）。', null, null, null);
INSERT INTO `abs_base_info_child` VALUES ('162', '45', 'SQ1768', '恒泰弘泽-华远盈都商业资产支持专项计划C类资产支持证券', 'AAA', null, '0.10', '1.36', '2035-2-14', null, '6.49', '就普通分配而言，A类、B类、和C类资产支持证券的预期收益均为每年分配，A类资产支持证券的本金偿付为每年还本（每年向A类资产支持证券偿还的本金为预期分配本金，超额分配本金的分配按照《标准条款》第12.2.1条的约定执行），B类和C类资产支持证券的本金偿付为到期还本。\n在A类、B类和C类资产支持证券正常存续情况下，收益分配日指专项计划存续期内，自2018年起每一自然年度的2月14日（若该日为非工作日则为该日后的第一个工作日）。', '就普通分配而言，A类、B类、和C类资产支持证券的预期收益均为每年分配。在A类、B类和C类资产支持证券正常存续情况下，收益分配日指专项计划存续期内，自2018年起每一自然年度的2月14日（若该日为非工作日则为该日后的第一个工作日）。', null, null, null);
INSERT INTO `abs_base_info_child` VALUES ('163', '46', 'SQ9457', '慧聪一期资产支持专项计划优先A级', 'AAA', null, '154.0%', '53.1%', '2019-12-30', null, '5.5%', '在每个兑付日按照《标准条款》第13条约定的顺序支付优先级资产支持证券的预期收益和/或本金。', '就专项计划的循环期而言，系指循环期内自专项计划设立日起每满3个公历月的对应日（该公历月无对应日的，为该公历月最后一日）；就专项计划的分配期而言，系指分配期内，预期到期日及该日前每个公历月的对应日，上述日期不是工作日的，则顺延至下一工作日。', null, null, null);
