INSERT INTO `abs_base_info_child` VALUES ('167', '47', 'SQ4455', '国兴租赁2016优先级', 'AA+', null, '2.46', '90.0%', '2019-04-26', null, '5.80', '（一）违约事件发生前，计划管理人应按照下列顺序对专项计划账户内的资金进行相应的分配或运用。\n1、回收款科目项下的资金在相应兑付日按照如下顺序进行分配（若同一顺序的多笔款项不能足额分配时，按各项金额的比例支付，且不足部分在下一期支付）：\n（1） 支付专项计划应承担的税收；\n（2） 支付登记托管机构的资产支持证券上市、登记、资金划付等相关费用；\n（3） 支付资产服务机构垫付的执行费用、计划管理人的管理费（如需）、托管银行的托管费、资产服务机构的服务费（如有）、跟踪评级费、审计费及其他专项计划费用；\n（4） 支付优先级资产支持证券的当期预期收益；\n（5） 支付优先级资产支持证券的本金，直至优先级资产支持证券的本金全部支付完毕；\n（6） 优先级资产支持证券本金全部清偿完毕后，以剩余资金为限返还差额支付承诺人履行差额补足义务已支付的款项；\n（7） 优先级资产支持证券本金全部清偿完毕并返还差额支付承诺人相关款项后，在次级资产支持证券持有人一致同意的前提下，剩余资金及其他专项计划剩余资产原状作为次级资产支持证券持有人的本金及收益支付给次级资产支持证券持有人', '于每个兑付日（每年1月、4月、7月、10月的第26日）支付优先级资产支持证券的当期预期收益', null, null, null);
