INSERT INTO `bond_base_info` VALUES ('452', 'SF2358', '共和县金河水泥有限责任公司2015年非公开发行公司债券', '15金河债', '普通公司债', '报价系统', null, null, null, null, '\"为保障本期债券持有人的合法权益，针对金河水泥有限责任公司2015年非公开发行公司债券相关事宜，公司股东吕东、何贤均、俞国胜等三名保证人为本期债券签署了《不可撤销保证协议》，协议规定本期债券由发行人吕东、何贤均、毛裕道三位股东提供信用担保，信用担保期限为债券到期并归还本金利息结束止。\r\n三位担保人中吕东为公司董事长、执行董事、法定代表人，何贤均为公司股东、监事，毛裕道为公司股东在公司内无任职。三位保证人资信良好，具有良好的代偿能力，资产无受限情况，此前均无对外担保情况。其中，担保人公司实际控制人吕东除拥有本公司股权外，还拥有青海香咔梅朵牧业有限公司董事长、执行董事、法定代表人，青海香咔梅朵牧业有限公司成立于2014年12月11日，注册资本5,000万元，吕东拥有该公司50%股权。另两位担保人何贤均、毛裕道分别拥有该牧业公司22%、10%的股权。三位担保人名下存款、股票等有价证券以及房产、车辆无受限情况，不存在后续权利限制安排，为本期债券提供信用担保。\"\r\n', '私募', '0.5', '0.5', '0.5', '24个月', '2年', '8%', '2015-12-10 00:00:00', '2016-01-08 00:00:00', '2015-11-16 00:00:00', '2015-12-10 00:00:00', '2017-12-10 00:00:00', null, null, null, null, null, null, null, null, '共和县金河水泥有限责任公司', null, '制造业', '青海', '共和县', '青海证监局', '大理岩开采、水泥生产销售', '民企', '否', null, null, null, '柯喜斌09747510022', '国开证券有限责任公司', '赵铭、何燕飞', '北京证监局', '瑞华会计师事务所', '景风贤、石建强', '青海君剑律师事务所', '罗兵、宁洲', null, null, null, null, '国开证券有限责任公司', '赵铭、何燕飞', '01051789047', '北京证监局', null, null, null, null, null, null, null, null, null, '1', '2017-03-02 14:18:50', '2017-03-08 16:33:55', null, '1', null, null, '1', 'LS50');
