INSERT INTO `bond_base_info` VALUES ('548', null, null, '15名轩', '', null, null, null, null, null, '1、发行人将其所持有的长荣股份(300195.SZ) 2,200万股股票及其孳息一并质押给债券受托管理人，用于对债券持有人交换股份和为本次债券本息偿付提供担保。其中1,597.5万股用于对债券持有人交换股份和为本次债券本息偿付提供担保；602.5万股不可用于对债券持有人交换股份，仅为本次债券本息偿付提供担保。\n2、同时，李莉女士（发行人和长荣股份的控股股东及实际控制人）将其持有的长荣股份(300195.SZ) 512万股股票及其孳息一并质押给债券受托管理人，用于对本次可交换公司债券的本息偿付提供担保，该512万股股票不用于对债券持有人的交换股份。李莉女士承诺上述股票在本次可交换公司债券的付息日和到期日不存在任何限售条件，且不违反相关法规和其本人对上市公司的相关承诺。\n3、发行人及李莉女士承诺，本次可交换公司债券存续期间，如果质押担保比例低于约定水平，将按照约定及时补足质押物。为本次债券提供质押安排的长荣股份股票不存在设定其他担保及权利受限情况。本次债券存续期内，发行人不减持其持有的其他长荣股份的股票。', '私募', '3.80', null, null, '12个月', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '天津名轩投资有限公司', null, '信息传输、软件和信息技术服务业', '天津', '天津', '天津证监局', '印刷装备制造和股权投资', '民企', '否', null, null, null, '李莉02286908559', '齐鲁证券有限公司', '孙晓刚、李硕', null, '信永中和会计师事务所', '张萱、周军', '北京观韬律师事务所', '张文亮、肖非', null, null, null, null, '中泰证券股份有限公司', null, null, null, null, null, null, null, null, null, null, null, null, '1', '2017-03-07 09:14:49', '2017-03-07 09:14:49', null, null, null, null, null, 'LS92');
