INSERT INTO `bond_base_info` VALUES ('554', null, null, '正邦2015可交换债', '', null, null, null, null, null, '1、股票质押担保\n本期债券预备用于交换的正邦科技（002157.SZ）股票4000万股及其孳息质押给债券受托管理人，用于对债券持有人交换股份和本期债券本息偿付提供担保。本期债券不设维持质押担保比例。\n公司由于按照约定调整或修正换股价格等原因，造成预备用于交换的股票数量少于未偿还可交换公司债券全部换股所需股票的，在换股价格调整日之前补足预备用于交换的股票，同时就该等股票办理担保手续。\n2、信用保证担保\n发行人控股股东、实际控制人林印孙先生为本期债券提供全额无条件不可撤销的连带责任保证担保。', '私募', '10.00', null, null, '24个月', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '正邦集团有限公司', null, '农、林、牧、渔业', '江西', '南昌', '江苏证监局', '饲料、养殖、农产品加工', '民企', '否', null, null, null, '周晓辉079186397601', '申万宏源证券承销保荐有限责任公司', '韩志谦、卢瑞华', null, '大华会计师事务所', '丁莉、刘荣萍、周华剑', '北京国枫律师事务所', '梁振东、张明', null, null, null, null, '申万宏源证券承销保荐有限责任公司', null, null, null, null, null, null, null, null, null, null, null, null, '1', '2017-03-07 09:14:50', '2017-03-07 09:14:50', null, null, null, null, null, 'LS45');
