INSERT INTO `sys_log` VALUES ('1664', '债券基本信息', '修改了正邦2015可交换债', '修改操作', '<span  style=\"color:blue;\">债券简称[正邦2015可交换债]被修改：</span><br/>{增信措施：修改前[]-->修改后[\"1、股票质押担保\r\n本期债券预备用于交换的正邦科技（002157.SZ）股票4000万股及其孳息质押给债券受托管理人，用于对债券持有人交换股份和本期债券本息偿付提供担保。本期债券不设维持质押担保比例。\r\n公司由于按照约定调整或修正换股价格等原因，造成预备用于交换的股票数量少于未偿还可交换公司债券全部换股所需股票的，在换股价格调整日之前补足预备用于交换的股票，同时就该等股票办理担保手续。\r\n2、信用保证担保\r\n发行人控股股东、实际控制人林印孙先生为本期债券提供全额无条件不可撤销的连带责任保证担保。\"\r\n]}；<br/>{核准发行规模（亿）：修改前[]-->修改后[10]}；<br/>{实际发行规模（亿）：修改前[]-->修改后[7.6]}；<br/>{托管规模（亿）：修改前[]-->修改后[7.6]}；<br/>{期限（年）：修改前[2年]-->修改后[24月]}；<br/>{发行日期：修改前[2015-12-25 12:00:00]-->修改后[2015-11-25 12:00:00]}；<br/>{上市日期：修改前[2017-11-20 12:00:00]-->修改后[2015-12-25 12:00:00]}；<br/>{核准日期：修改前[]-->修改后[2015-11-17 12:00:00]}；<br/>{发行人联系方式：修改前[]-->修改后[周晓辉079186397601]}；<br/>{主营业务：修改前[]-->修改后[饲料、养殖、农产品加工]}；<br/>{企业性质：修改前[]-->修改后[民企]}；<br/>{注册地（省）：修改前[]-->修改后[江西]}；<br/>{注册地（市）：修改前[]-->修改后[南昌市]}；<br/>{发行人所属证监局：修改前[]-->修改后[江西证监局]}；<br/>{是否为金融行业：修改前[]-->修改后[否]}；<br/>{主承销商名称：修改前[无]-->修改后[申万宏源证券承销保荐有限责任公司]}；<br/>{主承销商项目负责人：修改前[]-->修改后[韩志谦、卢瑞华]}；<br/>{主承销商所属证监局：修改前[]-->修改后[新疆证监局]}；<br/>{会计师事务所名称：修改前[]-->修改后[大华会计师事务所]}；<br/>{会计师事务所签字会计师：修改前[]-->修改后[丁莉、刘荣萍、周华剑]}；<br/>{律师事务所名称：修改前[]-->修改后[北京国枫律师事务所]}；<br/>{律师事务所签字律师：修改前[]-->修改后[梁振东、张明]}；<br/>{受托管理人负责人：修改前[]-->修改后[韩志谦、卢瑞华]}；<br/>{受托管理人负责人联系方式：修改前[]-->修改后[01088085923]}；<br/>{受托管理人所属证监局：修改前[]-->修改后[新疆证监局]}；<br/>', 'admin', '1', '2017-03-08 15:59:52', '2017-03-08 15:59:52');
