INSERT INTO `sys_log` VALUES ('1669', '债券基本信息', '修改了15金河债', '修改操作', '<span  style=\"color:blue;\">债券简称[15金河债]被修改：</span><br/>{增信措施：修改前[]-->修改后[\"为保障本期债券持有人的合法权益，针对金河水泥有限责任公司2015年非公开发行公司债券相关事宜，公司股东吕东、何贤均、俞国胜等三名保证人为本期债券签署了《不可撤销保证协议》，协议规定本期债券由发行人吕东、何贤均、毛裕道三位股东提供信用担保，信用担保期限为债券到期并归还本金利息结束止。\r\n三位担保人中吕东为公司董事长、执行董事、法定代表人，何贤均为公司股东、监事，毛裕道为公司股东在公司内无任职。三位保证人资信良好，具有良好的代偿能力，资产无受限情况，此前均无对外担保情况。其中，担保人公司实际控制人吕东除拥有本公司股权外，还拥有青海香咔梅朵牧业有限公司董事长、执行董事、法定代表人，青海香咔梅朵牧业有限公司成立于2014年12月11日，注册资本5,000万元，吕东拥有该公司50%股权。另两位担保人何贤均、毛裕道分别拥有该牧业公司22%、10%的股权。三位担保人名下存款、股票等有价证券以及房产、车辆无受限情况，不存在后续权利限制安排，为本期债券提供信用担保。\"\r\n]}；<br/>{核准发行规模（亿）：修改前[]-->修改后[0.5]}；<br/>{实际发行规模（亿）：修改前[]-->修改后[0.5]}；<br/>{托管规模（亿）：修改前[]-->修改后[0.5]}；<br/>{期限（年）：修改前[2年]-->修改后[24月]}；<br/>{发行日期：修改前[2016-01-08 12:00:00]-->修改后[2015-12-10 12:00:00]}；<br/>{上市日期：修改前[2017-12-01 12:00:00]-->修改后[2016-01-08 12:00:00]}；<br/>{核准日期：修改前[]-->修改后[2015-11-16 12:00:00]}；<br/>{发行人联系方式：修改前[]-->修改后[柯喜斌09747510022]}；<br/>{主营业务：修改前[]-->修改后[大理岩开采、水泥生产销售]}；<br/>{企业性质：修改前[]-->修改后[民企]}；<br/>{注册地（省）：修改前[]-->修改后[青海]}；<br/>{注册地（市）：修改前[]-->修改后[共和县]}；<br/>{发行人所属证监局：修改前[]-->修改后[青海证监局]}；<br/>{主承销商项目负责人：修改前[]-->修改后[赵铭、何燕飞]}；<br/>{主承销商所属证监局：修改前[]-->修改后[北京证监局]}；<br/>{会计师事务所名称：修改前[]-->修改后[瑞华会计师事务所]}；<br/>{会计师事务所签字会计师：修改前[]-->修改后[景风贤、石建强]}；<br/>{律师事务所名称：修改前[]-->修改后[青海君剑律师事务所]}；<br/>{律师事务所签字律师：修改前[]-->修改后[罗兵、宁洲]}；<br/>{受托管理人负责人：修改前[]-->修改后[赵铭、何燕飞]}；<br/>{受托管理人负责人联系方式：修改前[]-->修改后[01051789047]}；<br/>{受托管理人所属证监局：修改前[]-->修改后[北京证监局]}；<br/>', 'admin', '1', '2017-03-08 16:33:55', '2017-03-08 16:33:55');
