INSERT INTO `sys_log` VALUES ('1672', '债券基本信息', '修改了15名轩02', '修改操作', '<span  style=\"color:blue;\">债券简称[15名轩02]被修改：</span><br/>{增信措施：修改前[]-->修改后[1、发行人将其所持有的长荣股份(300195.SZ) 1,850万股股票及其孳息一并质押给债券受托管理人，用于对债券持有人交换股份和为本次债券本息偿付提供担保。\r\n其中，1,198.125万股用于对债券持有人交换股份和为本次债券本息偿付提供担保；651.875万股不可用于对债券持有人交换股份，仅为本次债券本息偿付提供担保。\r\n2、同时，李莉女士（发行人和长荣股份的控股股东及实际控制人）将其持有的长荣股份(300195.SZ)433万股股票及其孳息一并质押给债券受托管理人，用于对本次可交换公司债券的本息偿付提供担保，该433万股股票不用于对债券持有人的交换股份。李莉女士承诺上述股票在本次可交换公司债券的付息日和到期日不存在任何限售条件，且不违反相关法规和其本人对上市公司的相关承诺。\r\n3、发行人及李莉女士承诺，本次可交换公司债券存续期间，如果质押担保比例低于约定水平，将按照约定及时补足质押物。为本次债券提供质押安排的长荣股份股票不存在设定其他担保及权利受限情况。本次债券存续期内，发行人不减持其持有的其他长荣股份的股票。]}；<br/>{核准发行规模（亿）：修改前[]-->修改后[3.2]}；<br/>{实际发行规模（亿）：修改前[]-->修改后[3.2]}；<br/>{托管规模（亿）：修改前[]-->修改后[3.2]}；<br/>{核准日期：修改前[]-->修改后[2015-10-23 12:00:00]}；<br/>{发行人联系方式：修改前[]-->修改后[李莉02286908559]}；<br/>{主营业务：修改前[]-->修改后[印刷装备制造和股权投资]}；<br/>{企业性质：修改前[]-->修改后[民企]}；<br/>{注册地（省）：修改前[]-->修改后[天津]}；<br/>{注册地（市）：修改前[]-->修改后[北辰区]}；<br/>{发行人所属证监局：修改前[]-->修改后[天津证监局]}；<br/>{主承销商项目负责人：修改前[]-->修改后[孙晓刚、李硕]}；<br/>{主承销商所属证监局：修改前[]-->修改后[山东证监局]}；<br/>{会计师事务所名称：修改前[]-->修改后[信永中和会计师事务所]}；<br/>{会计师事务所签字会计师：修改前[]-->修改后[张萱、周军]}；<br/>{律师事务所名称：修改前[]-->修改后[北京观韬律师事务所]}；<br/>{律师事务所签字律师：修改前[]-->修改后[张文亮、肖非]}；<br/>{受托管理人负责人：修改前[]-->修改后[孙晓刚、李硕]}；<br/>{受托管理人负责人联系方式：修改前[]-->修改后[01059013981]}；<br/>{受托管理人所属证监局：修改前[]-->修改后[山东证监局]}；<br/>', 'admin', '1', '2017-03-09 09:16:49', '2017-03-09 09:16:49');
